import './App.css';

import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';
import {BrowserRouter as Router,Routes} from "react-router-dom"



function App() {
  return (

    <div>
    <Router>
      <Header/>

      <Routes path="/create" component={AddTimeTable} ></Routes>

    </Router>
  </div>      

  );
}


export default App;
